import AppBody from "./components/AppBody/AppBody";
import Feed from "./components/Feed/Feed";
import NavBar from "./components/NavBar/NavBar";
import CreatePollPage from "./components/Voting/Admin/CreatePollPage";
import ManagePollPage from "./components/Voting/Admin/ManagePollPage";
import PollEventPage from "./components/Voting/User/PollEventPage";


const App = () => {
  return (
    <>
      <Routes>
        <Route exact path="/" element={<Feed />} />
        <Route exact path="/polls" element={<PollEventPage />} />
        <Route exact path="/create-poll" element={<CreatePollPage />} />
        <Route exact path="/manage-poll" element={<ManagePollPage />} />
      </Routes>
      <NavBar /> <AppBody />
    </>
  );
};

export default App;
